import React from 'react';
import { Button, TextField, Typography, Container } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Home () {
  const navigate = useNavigate();

  return (
    <Container
      style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        height: '30vh',
        background: 'linear-gradient(to right, #ff7e5f, #feb47b)', // Colorful gradient background
      }}
    >
      <Typography variant="h4" style={{ marginBottom: '20px', color: '#fff' }}>
        Sign In
      </Typography>
      <TextField
        label="User ID"
        variant="outlined"
        type="text"
        style={{ marginBottom: '20px', width: '300px' }}
      />
      <TextField
        label="Password"
        variant="outlined"
        type="password"
        style={{ marginBottom: '20px', width: '300px' }}
      />
      <Button
        variant="contained"
        color="primary"
        onClick={() => navigate('/dashboard')}
        style={{
          backgroundColor: '#3700b3', // Custom color for the button
          color: '#fff',
          padding: '10px 20px',
          borderRadius: '5px',
          '&:hover': {
            backgroundColor: '#2f009a', // Darker shade on hover
          },
        }}
      >
        Sign In
      </Button>
    </Container>
  );
};

export default Home;
